import React, { useState, useEffect, useMemo } from 'react';
import './Review.css';
import { getCategoryForPiiType } from './piiCategories';

function Review({ fileName, fileType, detectedPii, onProceed, onCancel }) {
  const [reviewItems, setReviewItems] = useState([]);

  useEffect(() => {
    if (detectedPii) {
      setReviewItems(
        detectedPii.map((item, index) => {
          // Assuming backend sends confidence already scaled to 0-100 (e.g., 95 for 95%)
          // If backend sends 0-1, you would need to multiply by 100 here.
          // Based on your app.py, it should be sending 0-100.
          const displayConfidence = Math.round(item.confidence !== undefined ? item.confidence : item.avgConfidence); 

          return {
            id: item.id || `${item.detect}-${item.start || item.column}-${index}`,
            ...item,
            confidence: displayConfidence,
            avgConfidence: displayConfidence, // Keep avgConfidence for tabular display if needed
            ignore: displayConfidence < 70 ? true : (item.ignore || false)
          };
        })
      );
    }
  }, [detectedPii]);

  const handleIgnoreChange = (id) => {
    setReviewItems(prevItems =>
      prevItems.map(item =>
        item.id === id ? { ...item, ignore: !item.ignore } : item
      )
    );
  };

  const handleProceedClick = () => {
    // Convert confidence back to 0-1 range for backend when sending it back
    const itemsForBackend = reviewItems.map(item => ({
      ...item,
      // Use original 'item.confidence' if it was a number, otherwise default to 0
      // Ensure it's divided by 100 if it was stored as 0-100 in reviewItems state.
      confidence: (item.confidence !== undefined ? item.confidence / 100 : 0),
      avgConfidence: (item.avgConfidence !== undefined ? item.avgConfidence / 100 : 0)
    }));
    onProceed(itemsForBackend);
  };

  const groupedReviewItems = useMemo(() => {
    const groups = {};
    reviewItems.forEach(item => {
      const category = getCategoryForPiiType(item.detect);
      if (!groups[category]) {
        groups[category] = [];
      }
      groups[category].push(item);
    });
    return groups;
  }, [reviewItems]);

  const renderTableContent = (items) => {
    if (fileType === 'Text file' || fileType === 'Image file' || fileType === 'Document file') {
      return (
        <>
          <thead>
            <tr>
              <th>Word</th>
              <th>Entity</th>
              <th>PII_Confidence</th>
              <th>Ignore</th>
            </tr>
          </thead>
          <tbody>
            {items.map(item => (
              <tr key={item.id}>
                <td>{item.word}</td>
                <td>{item.detect}</td>
                <td className={item.confidence < 70 ? 'confidence-low' : 'confidence-high'}>
                  {item.confidence}%
                </td>
                <td>
                  <input
                    type="checkbox"
                    checked={item.ignore}
                    onChange={() => handleIgnoreChange(item.id)}
                  />
                </td>
              </tr>
            ))}
          </tbody>
        </>
      );
    } else if (fileType === 'Tabular file') {
      return (
        <>
          <thead>
            <tr>
              <th>Column</th>
              <th>Entity</th>
              <th>Top data (First 2 rows)</th>
              <th>PII_Confidence (Avg)</th>
              <th>Ignore</th>
            </tr>
          </thead>
          <tbody>
            {items.map(item => (
              <tr key={item.id}>
                <td>{item.column}</td>
                <td>{item.detect}</td>
                <td>
                  {Array.isArray(item.topData) ? item.topData.slice(0, 2).join(', ') : ''}
                  {Array.isArray(item.topData) && item.topData.length > 2 && '...'}
                </td>
                <td className={item.avgConfidence < 70 ? 'confidence-low' : 'confidence-high'}>
                  {item.avgConfidence}%
                </td>
                <td>
                  <input
                    type="checkbox"
                    checked={item.ignore}
                    onChange={() => handleIgnoreChange(item.id)}
                  />
                </td>
              </tr>
            ))}
          </tbody>
        </>
      );
    }
    return null;
  };

  return (
    <div className="modal-overlay">
      <div className="review-modal-content">
        <div className="modal-header">
          <h2>Review Before Anonymization</h2>
          <button className="close-button" onClick={onCancel}>&times;</button>
        </div>
        <div className="review-modal-body">
          <p>File: <strong>{fileName}</strong> (Type: {fileType})</p>
          <div className="review-table-container">
            {Object.keys(groupedReviewItems).length > 0 ? (
              Object.keys(groupedReviewItems).sort().map(category => (
                <div key={category} className="pii-category-group">
                  <h3>{category}</h3>
                  <table>
                    {renderTableContent(groupedReviewItems[category])}
                  </table>
                </div>
              ))
            ) : (
              <p className="no-pii-message">No PII detected for this file, or data not available for review.</p>
            )}
          </div>
          <p className="note-text">Note: Those below 70% automatically marked as ignore (NONE_PII).</p>
        </div>
        <div className="modal-footer">
          <button className="proceed-button" onClick={handleProceedClick}>Proceed</button>
        </div>
      </div>
    </div>
  );
}

export default Review;
